    {label: 'Mushroom', type: 'mushroom'},
    {label: 'Pepperoni', type: 'pepperoni'},
];

const Controls: React.FC<ControlsProps> = (props) => {
    return <ControlsContent>
        <Control/>

    </ControlsContent>
